class ViewController: UIViewController {

  
    override func viewDidLoad() {
        super.viewDidLoad()
        // Do any additional setup after loading the view.
    }

    @IBAction func sendPostButton(_ sender: Any) {
        
        var sURL: String!
        sURL = "https://hipolabs.com/api/internship-applications/"
        let serializer = DataResponseSerializer(emptyResponseCodes: Set([201]))
        
        var sampleRequest = URLRequest(url: URL(string: sURL)!)
        sampleRequest.httpMethod = HTTPMethod.post.rawValue
        AF.request(sampleRequest).uploadProgress{progress in}.response(responseSerializer:serializer){response in
        
        if(response.error == nil){
            var responseString: String!
            responseString = ""
            
            if(response.data != nil){
                responseString = String(bytes: response.data!,encoding: .utf8)
            }
            else{
                responseString = response.response?.description
            }
            print(responseString ?? "")
            print(response.response?.statusCode)
            
            var responseDate: NSData!
            responseDate = response.data! as NSData
            var idatalenght = responseDate.length
            print("Size: \(idatalenght) bytes")
            print("response time: \(response)")
            
        }
        }
    }
    
   


